import React from 'react'

const Stories = (props) => {
    const stories = props.data;
    console.log('kiran', stories)
    return ( 
       <div>
           {
           stories &&
           stories.data.map((item, i) => (
               <h1>{console.log(item.title)}</h1>
           ))}
       </div>
     );
}
 
export default Stories;
